import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Typography, Grid } from '@mui/material';

const HomePage = () => {
  const people = [
    { id: 1, name: 'Person 1', photo: 'https://images.unsplash.com/photo-1599566150163-29194dcaad36?crop=faces&fit=crop&w=200&h=200', description: 'Description of Person 1' },
    { id: 2, name: 'Person 2', photo: 'https://images.unsplash.com/photo-1524504388940-b1c1722653e1?crop=faces&fit=crop&w=200&h=200', description: 'Description of Person 2' },
    { id: 3, name: 'Person 3', photo: 'https://images.unsplash.com/photo-1494790108377-be9c29b29330?crop=faces&fit=crop&w=200&h=200', description: 'Description of Person 3' }
  ];

  return (
    <div className="homepage">
      <Typography variant="h1" gutterBottom>People Museum</Typography>
      <Grid container spacing={2}>
        {people.map(person => (
          <Grid item xs={4} key={person.id}>
            <Link to={`/person/${person.id}`} style={{ textDecoration: 'none' }}>
              <img src={person.photo} alt={person.name} className="photo" sx={{ width: '100px', height: '100px', borderRadius: '8px' }} />
              <Typography variant="body1" align="center" gutterBottom>{person.name}</Typography>
            </Link>
          </Grid>
        ))}
      </Grid>
      <Grid container justifyContent="center" spacing={2}>
        <Grid item>
          <Link to="/add-persona" style={{ textDecoration: 'none' }}>
            <Button variant="contained" color="primary">Add Persona</Button>
          </Link>
        </Grid>
        <Grid item>
          <Link to="/add-collection" style={{ textDecoration: 'none' }}>
            <Button variant="contained" color="primary">Add Collection</Button>
          </Link>
        </Grid>
      </Grid>
    </div>
  );
}

export default HomePage;
